import React from 'react';
import { Link } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';

function Home() {
  return (
    <div className="container mt-5 text-center">
      <h1 className="mb-4">Welcome to Shohoz Clone</h1>
      <Link to="/bus" className="btn btn-primary m-2">Search for Bus Tickets</Link>
      <Link to="/signup" className="btn btn-outline-secondary m-2">Sign Up</Link>
      <Link to="/login" className="btn btn-outline-dark m-2">Login</Link>
    </div>
  );
}

export default Home;
